import React, { Component } from 'react'
import NewsItem from './NewsItem';

export class News extends Component {
  render() {
    return (
      <>
        <div className="container my-3">
          <h2>News Headlines</h2>
          <div className="row">
            <div className="col-md-4">
              <NewsItem />
            </div>
            <div className="colmd-4">
              <NewsItem />
            </div>
            <div className="colmd-4">
              <NewsItem />
            </div>
          </div>          
        </div>
      </>
    );
  }
}

export default News
